import * as React from "react";
import { Routes, Route, Link } from "react-router-dom";
import { isPropertySignature } from "typescript";
import "./App.css";

export default function App() {
  return (
    <div className="App">
      <h1>Hour Logger</h1>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="dayview" element={<DayView />} />
      </Routes>
    </div>
  );
}

// App.js
function Home() {
  return (
    <>
      <main>
        <h2>Welcome to the homepage!</h2>
        <p>You can do this, I believe in you.</p>
      </main>
      <nav>
        <Link to="/dayview">view day</Link>
      </nav>
    </>
  );
}

type Props = {};

type state = {
  howWasYourDay: string;
};

class DayView extends React.Component<Props, state> {
  render(): React.ReactNode {
    return (
      <>
        <main>
          <h2>July 1st</h2>
          <HowWasYourDayForm />
        </main>
        <nav>
          <Link to="/">Home</Link>
        </nav>
      </>
    );
  }
}

class HowWasYourDayForm extends React.Component {
  constructor(props: any, ){
    super(props)
    this.state = {formOne: ""};

    this.handleChange = this.handleChange.bind(this);
  }

  render() {
    return (
      <form onSubmit={() => alert("submit")}>
        <label>What did you work on today?</label>
        <br />
        <textarea />
        <br />
        <input type="submit" value="Submit" />
      </form>
    );
  }
}
